import React from "react";
import Card from "../UI/Card";
import styles from "./UserForm.module.css";

const UserForm = (props) => {
  const submitHandler = (event) => {
    event.preventDefault();
  };
  return (
    <Card className={styles.form}>
      <form className={`${styles.input}`} onSubmit={submitHandler}>
        <div className="child-name">
          <label htmlFor="surname">姓</label>
          <input id="surname" type="text"></input>
          <label htmlFor="first-name">名</label>
          <input id="first-name" type="text"></input>
        </div>
        <div className="child-age">
          <label htmlFor="age">生年月日</label>
          <input id="age" type="date"></input>
        </div>
        <div className="child-sex">
          <input type="radio" id="male" />
          男
          <input type="radio" id="female" />
          女
          <input type="radio" id="other" />
          その他
        </div>
        <button type="submit">Submit</button>
      </form>
    </Card>
  );
};

export default UserForm;
